import React from "react";
import { Row, Col } from "react-bootstrap";
import board_image from "./board-image.png";
import "./EntryComponent.scss";

const EntryComponent = (props) => {
  return (
    <Row md="2" sm="1" className="justify-content-around mt-5">
      <Col className="image-container" md="4" sm="3" sm={{ order: "first" }}>
        <img src={board_image} alt="" />
      </Col>
      <Col className="intro" md="4" sm="6" sm={{ order: "last" }}>
        <h1>Play Xiangqi OnLine for Free</h1>
        <button className="play-button">Play</button>
      </Col>
    </Row>
  );
};

export default EntryComponent;
